    "2016-08-06T09:12:40.195045",nt"name": "arizona-social-vulnerability-index",nt"isopen":
    false,nt"url": null,nt"notes": "The Social Vulnerability Index is derived
    from the 2000 US Census data. The fields included are percent minority, median household
    income, age (under 18 and over 64), population without a high school diploma, linguistically
    isolated households, and single female head of households with own children under
    18 (single moms). The data is at the block group level. Each field for each block
    group is assigned an index score of 0-3, based on whether the value of that dataset
    falls in the top quartile (score=3), second quartile (score=2), third quartile (score=1),
    or bottom quartile (score=0). The scores for each field are then added together
    to assign a comprehensive score to each block group (0-21). The highest scores are
    block groups that have the highest percentage of sensitive populations (highest
    percent minority, lowest per capita income, highest percent of population under
    18 and over 64, highest percentage of population without a high school degree, highest
    percent of linguistically isolated households, and highest percent of single female
    head of households). Zoe Heller of the US EPA Region 9's Communities and Ecosystems
    Division, is responsible for the design and development of the Social Vulnerability
    Index data set.",nt"license_title": null,nt"extras": [{ntt"key": "bbox-east-long",ntt"value":
